import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {
  return (
    <div>
    <form onSubmit={handleSubmit}>
      

      <input name="name" type="text"  value={name} onChange={setName}/>Name
      <input name="phone" type="tel" value={phone} 
      onChange={setPhone} pattern="[0-9]{4}-[0-9]{3}-[0-9]{3}"/>Phone
      <input name="email" type="email" value={email} onChange={setEmail}/>Email

      <button type="submit">Submit</button>




    </form>
    
    
    
    </div>
  );
};
